const Roomlist = ({ rooms }) => {
    return (
      <div className="blog-list">
        {rooms.map(room => (
          <div className="blog-preview" key={rooms.name} >
         
            <p>{ rooms.name }</p>
          </div>
        ))}
      </div>
    );
  }
   
  export default Roomlist;
